import React from 'react';
import backgroundImage from './background-image.webp';
import midgroundImage from './midground-image.jpg';
import foregroundImage from './foreground-image.webp';
import './mainMenu.module.css';

function MainMenu() {
    return (
        <div className="mainMenuContainer">
            {/* Parallax Background, Midground, and Foreground */}
            <div className="background"></div>
            <div className="midground"></div>
            <div className="foreground"></div>

            {/* Header Section */}
            <header className="header">
                <h1 className="logo">Senp<span id="highlight">ai</span> Suggests</h1>
            </header>

            {/* Welcome Message */}
            <div className="welcomeOverlay">
                <h1 className="welcomeText">Welcome to Senp<span id="highlight">ai</span> Suggests!</h1>
            </div>
        </div>
    );
}

export default MainMenu;
